  14,\n\t\"tags\": [],\n\t\"title\": \"Effects of elevated CO2 levels on eggs and
  larvae of a North Pacific flatfish (northern rock sole, Lepidopsetta polyxystra)
  from laboratory experiment studies from 2012-02-01 to 2013-09-30 (NCEI Accession
  0136906)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-12-20T18:47:24.206131\",\n\t\"name\":
  \"effects-of-elevated-co2-levels-on-eggs-and-larvae-of-a-north-pacific-flatfish-northern-rock-sol\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Bering Sea and Gulf of Alaska support
  a number of commercially important flatfish fisheries. These high latitude ecosystems
  are predicted to be most immediatelynimpacted by ongoing ocean acidification but
  the range of responses by commercial fishery species has yet to be fully explored.
  In this study we examined the growth responsesnof northern rock sole (Lepidopsetta
  polyxystra) eggs and larvae across a range of CO2 levels (ambient to 1500 uatm)
  to evaluate the potential sensitivity to ocean acidification.nLaboratory-spawned
  eggs and larvae were reared at 8 degrees Celsius in a flow-through culture system
  in which CO2 levels were maintained via computer-controlled injection of CO2ninto
  a seawater conditioning tank. Overall, we observed only minor effects of elevated
  CO2 level on sizes of northern rock sole larvae. Size at hatch differed among offspring
  from four different females, but there was no significant effect of CO2 level on
  egg survival or size at hatch. In three separate larval growth trials, there was
  little effect of CO2 level on growth rates through the first 28 days post-hatch
  (DPH). However, in the one trial extended to 60 DPH, fish reared at the highest
  CO2 level had lower condition factors after 28 DPH suggesting that larvae undergoing
  metamorphosis may be more sensitive to environmental hypercapnia than earlier pre-flexion
  stages. These results suggest that while early life stages of northern rock sole
  are less sensitive to ocean acidification than previously examined flatfishes, they
  may be more sensitive to elevated CO2 levels than a previously studied gadid with
  a similar geographic range.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
